import React from 'react';
import './EditUser.css'; 

const EditUser = () => {
  return (
    <div className="login-box">
      <h2>Edit User</h2>
      <input className="input-control" type="text" placeholder="Username" />
      <input className="input-control" type="text" placeholder="Email" />
      <button className="signin-button">Save Changes</button>
    </div>
  );
};

export default EditUser;
